import React from "react";
import logo from "./logo.svg";
import "./App.css";
import "typeface-roboto";
import { AppBar, Toolbar, Tabs, Typography, Tab } from "@material-ui/core";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import ReportWildFirePage from "./pages/ReportWildfirePage";
import StatisticsPage from "./pages/StatisticsPage";
import AlertsPage from "./pages/AlertsPage";

function App() {
  return (
    <Router>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h4" style={{ marginRight: "30px" }}>
            Fire Buster
          </Typography>
          <Tabs>
            <Link to={"/contact"} className="nav-link">
              Contact
            </Link>
            <Link to={"/about"} className="nav-link">
              About
            </Link>
            <Button href={"/"} label="Alerts" index={0}/>
            <Tab label="Report Wildfire" index={1} />
            <Tab label="Statistics" index={2} />
          </Tabs>
        </Toolbar>
      </AppBar>
      <Switch>
        <Route exact path="/" component={AlertsPage} />
        <Route path="/contact" component={ReportWildFirePage} />
        <Route path="/about" component={StatisticsPage} />
      </Switch>
    </Router>
  );
}

export default App;
